\" ) then\n\t\tcc -o ${TARGET_TEMP_DIR}/libmx.A${LIBRARY_VERSION_SUFFIX}.other.dylib \\\n\t\t\t$archlist -dynamiclib -nostdlib \\\n\t\t\t-install_name /usr/lib/libmx.A${LIBRARY_VERSION_SUFFIX}.dylib \\\n\t\t\t${TARGET_TEMP_DIR}/null${LIBRARY_VERSION_SUFFIX}.*.o \\\n\t\t\t-compatibility_version ${DYLIB_COMPATIBILITY_VERSION} \\\n\t\t\t-current_version ${DYLIB_CURRENT_VERSION}\n\n\n\t\tif( \"found\" == \"$ppc_found\" ) then\n\t\t\t# Put the three architectures together.\n\t\t\tlipo -output ${DSTROOT}/usr/lib/libmx${LIBRARY_VERSION_SUFFIX}.dylib -create \\\n\t\t\t\t${TARGET_TEMP_DIR}/libmx.A${LIBRARY_VERSION_SUFFIX}.other.dylib \\\n\t\t\t\t-arch ppc /Developer/SDKs/MacOSX10.3.9.sdk/usr/lib/libmx.A${LIBRARY_VERSION_SUFFIX}.dylib\n\t\telse\n\t\t\t/bin/cp -v ${TARGET_TEMP_DIR}/libmx.A${LIBRARY_VERSION_SUFFIX}.other.dylib ${DSTROOT}/usr/lib/libmx${LIBRARY_VERSION_SUFFIX}.dylib\n\t\tendif\n\telse\n\t\t/bin/cp -v /Developer/SDKs/MacOSX10.3.9.sdk/usr/lib/libmx.A.dylib  ${DSTROOT}/usr/lib/libmx${LIBRARY_VERSION_SUFFIX}.dylib\n\tendif\n\n\tunset archlist\nendif";
